Accounts_CustomFields_Description:
Turėtų būti galiojantis JSON, kurio raktai yra laukų pavadinimai, kuriuose yra laukų nustatymų žodynas. Pavyzdys:<br/><code> {
 "role": {
  "type": "select",
  "defaultValue": "student",
  "options": ["teacher", "student"],
  "required": true,
  "modifyRecordField": {
   "array": true,
   "field": "roles"
  }
 },
 "twitter": {
  "type": "text",
  "required": true,
  "minLength": 2,
  "maxLength": 10
 }
}</code>

Custom_Translations_Description:
Turėtų būti galiojantis JSON, kur raktai yra kalbos, kuriose yra raktinių žodžių ir vertimų žodynas. Pavyzdys: <br/><code>{
 "en": {
  "Channels": "Rooms"
 },
"pt": {
  "Channels": "Salas"
 }
}</code>
